import React from "react";
const axios = require('axios');
export const SecondPage = () => {

  var list = [];
  axios.get(`https://pokeapi.co/api/v2/pokemon/123/`).then((res) => {
    list = res.data;
    console.log("res.data",res.data);
  });

  return <div>{list}</div>;
};
